import Card from "react-bootstrap/Card";
import lock from "./lock.svg";
import unlock from "./unlock.svg";

export default function Hero() {
  return (
    <div className="jumbotron">
      <object data={unlock} type="image/svg+xml"></object>
    </div>
  );
}
